          <p className="text-light">Website desenvolvido por :Patricia Ruffino</p>

          <div className= "cont">
            <ul >
              <li>
           <a href="https://github.com/PatriciaRuffino" target="_blank" rel="noreferrer"><img className="linkedin" src= {github} alt= "github"/></a>
